/*Table structure for table `hospital_login` */

DROP TABLE IF EXISTS `hospital_login`;

CREATE TABLE `hospital_login` (
  `username` varchar(50) default NULL,
  `password` varchar(50) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `hospital_login` */

insert  into `hospital_login`(`username`,`password`) values ('hospital','hospital');

/*Table structure for table `patientregistration` */

DROP TABLE IF EXISTS `patientregistration`;

CREATE TABLE `patientregistration` (
  `c_id` int(11) NOT NULL auto_increment,
  `username` varchar(150) default NULL,
  `password` varchar(100) default NULL,
  `email` varchar(100) default NULL,
  `mobile` bigint(20) default NULL,
  `address` varchar(100) default NULL,
  `dob` date default NULL,
  `gender` varchar(100) default NULL,
  `image` mediumblob,
  `status` varchar(100) default NULL,
  PRIMARY KEY  (`c_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=latin1;

