/*Table structure for table `sendorg` */

DROP TABLE IF EXISTS `sendorg`;

CREATE TABLE `sendorg` (
  `org_id` int(20) NOT NULL auto_increment,
  `Select_Organ_Type` varchar(40) default NULL,
  `Donor_Name` varchar(40) default NULL,
  `Blood_group` varchar(40) default NULL,
  `height` int(20) default NULL,
  `weight` int(20) default NULL,
  `donar_age` int(20) default NULL,
  `hashcode` varchar(200) default NULL,
  PRIMARY KEY  (`org_id`)
